import { GET_ORDERS } from "../OrderActions/Types";

const initialState = {
  orders: [],
  order: {},
};

export default function (state = initialState, action) {
  switch (action.type) {
    case GET_ORDERS:
      return {
        ...state,
        ingredients: action.payload,
      };
    default:
      return state;
  }
}
